(15, 1, '2024-02-14 14:50:56', '2024-02-14 14:50:56', '<ul>\r\n 	<li><strong>Cosma Asia består av mycket saftigt kött eller delikat fisk, exotiskt och förfinat med lite ris, i god gelé.</strong>Cosma Asia för katter är en kompletterande kost tillverkat av endast naturliga ingredienser. Den höga andelen fågelkött eller tonfisk förser katten med en artriktig näring som dessutom har en oemotståndlig smak. Cosma Thai/Asia är tillverkat av färskt, vitt kött som tillretts med ris för en exotisk smak.\r\n<ul>\r\n 	<li><strong>Mix Fruits med 3 sorter innehåller: </strong>2 burkar var av Tonfisk &amp; kyckling med mango, Tonfisk &amp; kyckling med ananas, Tonfisk &amp; kyckling med papaya</li>\r\n 	<li><strong>Mix I med 4 sorter innehåller: </strong>2 burkar var av Tonfisk &amp; krabbkött / Kyckling &amp; räkor och 1 burk var av Kyckling &amp; tonfisk / Kyckling &amp; kycklinglever</li>\r\n 	<li><strong>Tonfisk &amp; krabbkött: </strong>ljusa tonfiskbitar med lättsmält krabbkött</li>\r\n 	<li><strong>Kyckling &amp; tonfisk:</strong> saftiga bitar av kyckling med vit tonfisk</li>\r\n 	<li><strong>Kyckling &amp; räkor:</strong> saftig kyckling med utsökta räkor</li>\r\n 	<li><strong>Kyckling &amp; kycklinglever: </strong>saftiga kycklingbitar med hälsosam kycklinglever</li>\r\n 	<li><strong>Tonfisk &amp; braxen:</strong> god tonfisk med braxen</li>\r\n 	<li><strong>Kyckling med barramund: </strong>mört kycklingkött med fisk</li>\r\n</ul>\r\n<strong>Cosma Asia i  överblick:</strong>\r\n<ul>\r\n 	<li>Premium-våtfoder för katter</li>\r\n 	<li><strong>Med stora mängder</strong> färskt kött eller fisk</li>\r\n 	<li><strong>Multiprotein</strong>: minst 2 högkvalitativa animaliska proteinkällor</li>\r\n 	<li>För en artanpassad kost</li>\r\n 	<li><strong>Exotiskt förfinat</strong> med lättsmält ris</li>\r\n 	<li><strong>Utan </strong>smakämnen, konserveringsmedel och färgämnen</li>\r\n</ul>\r\n<strong>Skäm bort din katt med mycket kärlek och Cosma!</strong></li>\r\n</ul>', 'Cosma Asia in Jelly 6 x 170 g', '', 'publish', 'open', 'closed', '', 'cosma-asia-in-jelly-6-x-170-g', '', '', '2024-02-14 14:51:04', '2024-02-14 14:51:04', '', 0, 'http://payment.test/?post_type=product&#038;p=15', 0, 'product', '', 0),
